import React, { Component } from "react";
// import { Link } from "react-router-dom";

const Navigation = (props) => {
    return (
        <div>
            <header>
                <p className="mini-header-txt ml-5">Need help? <i className="fab fa-whatsapp"></i> 081289879972</p>
            </header>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <img className="logo ml-4" src={require("../assets/logo.jpg")} alt="logo" />
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <form className="form-inline my-2 my-lg-0">
                        <input className="form-control" type="search" placeholder="Search" aria-label="Search" />
                        {/* <button className="btn btn-outline-success my-2 my-sm-0" type="submit"><i className="fas fa-search"></i></button> */}
                    </form>
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item">
                            <a className="nav-link" href="#">Add to cart<i className="fas fa-shopping-cart"></i></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Login <i className="fas fa-user-alt"></i></a>
                        </li>
                    </ul>
                </div>
            </nav>
        </div>
    )
};

export default Navigation;
